import React, { Component } from 'react';
import '../css/Header.css';
import '../css/Fade.css';

export default class Header extends Component {

    componentDidMount()
    {
        setTimeout( function()
        {
            var div = document.getElementsByClassName("HeaderName");
            div.innerHTML = "Matthew Lee Cline"
            console.log(div);


        }, 500);

    }

  render() {
    return (
      <div className="Header fade-in">
        <div className="HeaderBackground">
          <div className="HeaderName fade-in"></div>
        </div>
      </div>
    );
  }
}
